import React, { Component } from 'react';
import CardBox from '../../../../../components/CardBox/index';
import Select from 'react-select';
import IntlMessages from '../../../../../util/IntlMessages';
import Button from '@material-ui/core/Button';
import CheckCircleIcon from '@material-ui/icons/CheckCircle';
import RadioButtonUncheckedIcon from '@material-ui/icons/RadioButtonUnchecked';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import FormHelperText from '@material-ui/core/FormHelperText';

export class AddCallRegisterSetting extends Component {
  render() {
    return (
      <div className="col-md-12 col-lg-12 col-sm-12 d-flex flex-column bd-highlight mb-3 ">
        <CardBox styleName="col-md-12 col-lg-12 col-sm-12">
          <div className="table-responsive-material">
            <Table>
              <TableHead className="th-border-b">
                <TableRow>
                  <TableCell>
                    {' '}
                    <IntlMessages id="file.type" />
                  </TableCell>

                  <TableCell>
                    <IntlMessages id="file.title" />
                  </TableCell>
                  <TableCell>
                    <IntlMessages id="todo.labels" />
                  </TableCell>
                  <TableCell>
                    <IntlMessages id="publication.date" />
                  </TableCell>
                  <TableCell>
                    <IntlMessages id="material.professor.name" />
                  </TableCell>
                  <TableCell>
                    <IntlMessages id="associated.files.links" />
                  </TableCell>
                  <TableCell>
                    <IntlMessages id="dashboard.comments" />
                  </TableCell>

                  <RoleContext.Consumer>
                    {({ role }) => (
                      <Can
                        role={role}
                        perform="add-service"
                        yes={() => (
                          <TableCell>
                            <IntlMessages id="action.type.of.education" />
                          </TableCell>
                        )}
                      />
                    )}
                  </RoleContext.Consumer>
                </TableRow>
              </TableHead>
              <TableBody>
                {/* {this.props.listSupportCourse.map((cours) => {
                  return (
                    <SupportCoursListItems
                      cours={cours}
                      editShowModal={this.editShowModal}
                      pathAttached={this.props.match}
                      archived={false}
                      handleDelete={this.handleDelete}
                    />
                  );
                })} */}
              </TableBody>
            </Table>
          </div>
        </CardBox>
        <div className="d-flex flex-row-reverse bd-highlight col-md-6 col-lg-6 col-sm-12">
          <div className=" bd-highlight ">
            <Button
              variant="contained"
              className="bg-secondary text-white "
              style={{
                borderBottomLeftRadius: '10px',
                borderBottomRightRadius: '10px',
                borderTopLeftRadius: '10px',
                borderTopRightRadius: '10px',
                width: '100%',
                height: '80%',
                textTransform: 'capitalize',
              }}
              onClick={this.props.handleSubmit}
            >
              {this.props.values.isTheFirstInit ? (
                <IntlMessages id="superadmin.apply.button" />
              ) : (
                <IntlMessages id="button.modify" />
              )}
            </Button>
          </div>
          <div className=" bd-highlight mr-2">
            <Button
              variant="contained"
              style={{
                borderBottomLeftRadius: '10px',
                borderBottomRightRadius: '10px',
                borderTopLeftRadius: '10px',
                borderTopRightRadius: '10px',
                width: '100%',
                height: '80%',
                textTransform: 'capitalize',
              }}
              className=" bg-grey text-white "
              onClick={this.props.handleCancel}
            >
              <IntlMessages id="components.classes.formadd.buttonCancel" />
            </Button>
          </div>
        </div>
      </div>
    );
  }
}

export default AddCallRegisterSetting;
